const openInNewTab = url => {
    window.open(url, '_blank', 'noopener,noreferrer');
  };

class IntroPage extends Component {
    state = {  } 
    render() { 
        return (
                <div>
                    <h1>Welcome...</h1>
                    <button className="review" onClick={() => openInNewTab('/linklist')}>
                        Start Linking
                    </button>
                </div>
        );
    }
}
 
export default IntroPage;
